  -2.162 0.030782 *  \nregionsouthwest   -960.0      477.9  -2.009 0.044765 *  \n---\nSignif. codes:  0 ‘***’ 0.001 ‘**’ 0.01 ‘*’ 0.05 ‘.’ 0.1 ‘ ’ 1\n\nResidual standard error: 6062 on 1329 degrees of freedom\nMultiple R-squared:  0.7509,\tAdjusted R-squared:  0.7494 \nF-statistic: 500.8 on 8 and 1329 DF,  p-value: < 2.2e-16\n"},"metadata":{}}]},{"cell_type":"markdown","source":"From the Pr values, we can see that the following factors have the **most satistically significant** relationship with medical charges: \n* age\n* BMI\n* status on smoking\n* number of children\n\nOf course, having more children does not directly cause people to become healthier and decrease medical charges. We may need to look at another dataset to understand what the underlying causes are.\n\nAgain, you notice that gender does not have a significant relationship with medical charges.\n\nHowever, that is not true for region. A deeper dive can be done with more data exploring why the region has a statistically significant relationship (Pr more than 0.05) with medical charges. Possible reasons include environmental pollution, socio-economic status, access to healthcare, etc.\n\n## Conclusion\nTo predict medical charges of an individual for insurance calculations, we should look at their age, BMI, if they smoke, and the number of children they have. To increase the precision in our predictions, we can look at the region they live in too.","metadata":{}}]}